import React from "react";
import "./Header.css";
import { FaShoppingCart, FaSearch } from "react-icons/fa";
// import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div className="header">
      <a href="/" className="shop-name">
        FunNy /^^/
      </a>
      <div className="subheader">
        <Search />
        <span>/WELCOME/</span>
        <Cart />
      </div>
      <Navigation />
    </div>
  );
};

const Search = () => {
  return (
    <div className="search">
      <FaSearch className="search-icon"></FaSearch>
      <input id="search-box" type="text" name="search" />
    </div>
  );
};

const Cart = () => {
  return (
    <div className="cart">
      <FaShoppingCart className="cart-icon"></FaShoppingCart>
      <span>Cart</span>
      <span>($0.00)</span>
    </div>
  );
};

const Navigation = () => {
  return (
    <div className="navigation">
      <a href="#" className="navigation-item">
        HOME
      </a>
      <a href="#" className="navigation-item">
        PRODUCTS
      </a>
      <a href="#" className="navigation-item">
        COLLECTIONS
      </a>
      <a href="#" className="navigation-item">
        ABOUT US
      </a>
    </div>
  );
};
export default Header;
